import React, { Component } from 'react'

class Checkout extends Component {
    render() {

        const billingDetails = (
            <div>
                <h4>Billing Details:</h4>
            </div>
        )
        return (
            <div className='container'>
                {billingDetails}
            </div>
        )
    }
}

export default Checkout
